import React from 'react';
import './Users.css';

const users = [
  { id: 1, name: 'John Doe', email: 'john@mail.com', phone: '+91 98765 43210', status: 'Active' },
  { id: 2, name: 'Alice Smith', email: 'alice@mail.com', phone: '+91 91234 56789', status: 'Blocked' },
  { id: 3, name: 'Ravi Kumar', email: 'ravi@mail.com', phone: '+91 99876 54321', status: 'Active' },
];

export default function Users() {
  return (
    <div className="page users-page">
      <h2>Users</h2>
      <table className="table">
        <thead><tr><th>ID</th><th>Name</th><th>Email</th><th>Phone</th><th>Status</th></tr></thead>
        <tbody>
          {users.map(u => (
            <tr key={u.id}>
              <td>{u.id}</td><td>{u.name}</td><td>{u.email}</td><td>{u.phone}</td><td>{u.status}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}
